const humanDelay = (min, max) => Math.floor(Math.random() * (max - min + 1) + min);

const warmingSequences = [
  [
    { action: 'navigate', target: 'youtube.com', delay: humanDelay(2000, 5000) },
    { action: 'search', query: 'popular music 2024', delay: humanDelay(8000, 15000) },
    { action: 'click_video', index: humanDelay(0, 4), delay: humanDelay(3000, 6000) },
    { action: 'watch', duration: humanDelay(60, 180), delay: 0 },
    { action: 'like', probability: 0.3, delay: humanDelay(1000, 3000) },
    { action: 'scroll', direction: 'down', delay: humanDelay(2000, 4000) }
  ],
  [
    { action: 'navigate', target: 'youtube.com', delay: humanDelay(2000, 4000) },
    { action: 'scroll', direction: 'down', delay: humanDelay(3000, 6000) },
    { action: 'click_video', index: humanDelay(0, 7), delay: humanDelay(2000, 4000) },
