    { action: 'watch', duration: humanDelay(60, 150), delay: 0 }
  ]
];

const warmingTasks = accounts.map(account => {
  const sequenceIndex = Math.floor(Math.random() * warmingSequences.length);
  const sequence = warmingSequences[sequenceIndex].map(step => ({
    ...step,
    delay: Math.max((step.delay || 0) + humanDelay(-500, 500), 500)
  }));

  return {
    account_id: account.id,
    google_email: account.google_email,
    antidetect_profile_id: account.external_profile_id,
    antidetect_provider: account.provider,
    sequence_pattern: sequenceIndex + 1,
    warming_sequence: sequence,
    total_time_sec: sequence.reduce((s, a) => s + (a.delay || 0) + (a.duration || 0) * 1000, 0) / 1000
  };
});

return warmingTasks.map(t => ({ json: t }));

// PuppeteerÊé•Á∂öÊÉÖÂ†±ÊäΩÂá∫„Å®„Çπ„ÇØ„É™„Éó„ÉàÁîüÊàê
