// „Éï„É´„Çª„ÉÉ„Ç∑„Éß„É≥„Ç∑„Éü„É•„É¨„Éº„Ç∑„Éß„É≥Ôºà15-30ÂàÜÔºâ
const config = $input.first().json;
const duration = config.duration_minutes || 15;

const humanDelay = (min, max) => Math.floor(Math.random() * (max - min + 1) + min);

const activities = [
  'youtube_browse', 'youtube_search', 'youtube_watch', 
  'google_search', 'news_browse', 'social_check'
];

const sessionPlan = [];
let remainingTime = duration * 60;

while (remainingTime > 60) {
  const activity = activities[Math.floor(Math.random() * activities.length)];
  const activityDuration = humanDelay(60, Math.min(300, remainingTime - 30));

  sessionPlan.push({
    activity: activity,
    duration_sec: activityDuration,
    start_delay: humanDelay(2000, 5000)
  });

  remainingTime -= activityDuration;
}

return [{
  json: {
    action: 'full_session',
    account_id: config.account_id,
    total_duration_min: duration,
    session_plan: sessionPlan,
    activities_count: sessionPlan.length
  }
}];

// „É¨„Çπ„Éù„É≥„ÇπÁîüÊàê
